  `fmin_electricity` decimal(10, 2) NULL DEFAULT NULL,
  `fmax_voltage` decimal(10, 2) NULL DEFAULT NULL,
  `fmin_voltage` decimal(10, 2) NULL DEFAULT NULL,
  `fwelder_itemid` varchar(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT '0' COMMENT '焊工编号',
  `fjunction_itemid` varchar(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT '0' COMMENT '焊口编号',
  `fmachine_itemid` varchar(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT '0' COMMENT '焊机编号',
  `fwirefeedrate` decimal(10, 2) NULL DEFAULT NULL COMMENT '送丝速度',
  `fmachinemodel` varchar(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT '0' COMMENT '焊机信号',
  `fwirediameter` decimal(10, 2) NULL DEFAULT NULL COMMENT '焊丝直径',
