-- ----------------------------
-- Event structure for 每天定时清理待机数据
-- ----------------------------
DROP EVENT IF EXISTS `每天定时清理待机数据`;
delimiter ;;
CREATE EVENT `每天定时清理待机数据`
ON SCHEDULE
EVERY '1' DAY STARTS '2019-11-28 00:00:00'
DO DELETE FROM tb_live_data WHERE fstatus = 0
;
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
